import React from 'react';
import { useParams, Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaArrowLeft, FaCalendar, FaTag, FaServer, FaStar, FaDesktop, FaNetworkWired } from 'react-icons/fa';
import TableOfContents from '../../../components/TableOfContents';
import './VoleurWalkthrough.css';

const VoleurWalkthrough = () => {
  // Voleur Walkthrough data
  const writeup = {
    id: 'Voleur-walkthrough',
    title: 'Voleur Walkthrough',
    date: 'Aug 29, 2025',
    tags: ['Windows', 'Ad', 'Kerberos', 'Ldap', 'Smb', 'Kerberoast', 'Dpapi', 'Dcsync'],
    difficulty: 'Medium',
    os: 'Windows',
    ip: '10.10.11.76',
    content: `
# Overview

This Windows machine was discovered during network enumeration. [Add your overview here]

## Enumeration

[Add your enumeration steps here]

### Port Scanning

[Add nmap results and analysis]

![Port Scan Results](/writeup-images/Voleur-images/1.png)

### Service Enumeration

[Add service-specific enumeration]

![Service Enumeration](/writeup-images/Voleur-images/2.png)

## Exploitation

[Add your exploitation steps]

### Initial Access

[Describe how you gained initial access]

![Initial Access](/writeup-images/Voleur-images/3.png)

### User Flag

[Describe how you obtained the user flag]

![User Flag](/writeup-images/Voleur-images/4.png)

## Post Exploitation

[Add post-exploitation activities]

### Privilege Escalation

[Describe privilege escalation methods]

![Privilege Escalation](/writeup-images/Voleur-images/5.png)

### Root Flag

[Describe how you obtained the root flag]

![Root Flag](/writeup-images/Voleur-images/6.png)

## Lessons Learned

[Add what you learned from this machine]

## Tools Used

- Nmap - Port scanning and service enumeration
- [Add other tools used]

## References

- [Add references and resources]
    `
  };

  return (
    <motion.div 
      className="writeup-detail-page"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
    >
      <div className="writeup-header">
        <Link to="/writeups" className="back-button">
          <FaArrowLeft />
          <span>Back to Writeups</span>
        </Link>

        <motion.div 
          className="writeup-title-section"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2, duration: 0.6 }}
        >
          <h1>{writeup.title}</h1>

          <div className="writeup-meta">
            <div className="meta-item">
              <FaCalendar />
              <span>{writeup.date}</span>
            </div>
            <div className="meta-item">
              <FaTag />
              <span>Difficulty: {writeup.difficulty}</span>
            </div>
          </div>

          <div className="writeup-tags">
            {writeup.tags.map((tag, index) => (
              <motion.span
                key={tag}
                className="tag-badge"
                initial={{ scale: 0, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                transition={{ delay: 0.3 + index * 0.1, duration: 0.3 }}
                whileHover={{ scale: 1.1 }}
              >
                {tag}
              </motion.span>
            ))}
          </div>

          <div className="machine-info">
            <div className="machine-info-content">
              <div className="machine-info-left">
                <h6><FaServer /> Machine Information:</h6>
                <div className="machine-badges">
                  <span className="badge bg-primary">
                    <FaStar /> Difficulty: {writeup.difficulty}
                  </span>
                  <span className="badge bg-info">
                    <FaDesktop /> OS: {writeup.os}
                  </span>
                  <span className="badge bg-secondary">
                    <FaNetworkWired /> IP: {writeup.ip}
                  </span>
                </div>
              </div>
              <div className="machine-info-right">
                <img src="/writeup-images/Voleur-machine.png" alt="Voleur Walkthrough" className="machine-image" />
              </div>
            </div>
          </div>
        </motion.div>
      </div>

      <div className="writeup-layout">
        <motion.div 
          className="writeup-content"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.4, duration: 0.6 }}
        >
          <div className="markdown-content">
            {(() => {
              const lines = writeup.content.split('\n');
              const elements = [];
              let i = 0;

              while (i < lines.length) {
                const line = lines[i];

                if (line.startsWith('# ')) {
                  elements.push(<h1 key={i}>{line.substring(2)}</h1>);
                } else if (line.startsWith('## ')) {
                  elements.push(<h2 key={i}>{line.substring(3)}</h2>);
                } else if (line.startsWith('### ')) {
                  elements.push(<h3 key={i}>{line.substring(4)}</h3>);
                } else if (line.startsWith('```')) {
                  // Handle code blocks
                  const language = line.substring(3).trim();
                  const codeLines = [];
                  i++;

                  while (i < lines.length && !lines[i].startsWith('```')) {
                    codeLines.push(lines[i]);
                    i++;
                  }

                  elements.push(
                    <pre key={i} className="code-block">
                      <code className={language ? `language-${language}` : ''}>
                        {codeLines.join('\n')}
                      </code>
                    </pre>
                  );
                } else if (line.startsWith('![') && line.includes('](') && line.endsWith(')')) {
                  const altText = line.match(/\[(.*?)\]/)[1];
                  const imageSrc = line.match(/\((.*?)\)/)[1];
                  elements.push(
                    <div key={i} className="image-container">
                      <img src={imageSrc} alt={altText} className="content-image" />
                    </div>
                  );
                } else if (line.trim() === '') {
                  elements.push(<br key={i} />);
                } else {
                  // Process inline markdown
                  const processedLine = line
                    .replace(/\*\*(.*?)\*\*/g, '<strong>$1</strong>') // Bold
                    .replace(/\*(.*?)\*/g, '<em>$1</em>') // Italic
                    .replace(/`(.*?)`/g, '<code class="inline-code">$1</code>'); // Inline code

                  elements.push(
                    <p key={i} dangerouslySetInnerHTML={{ __html: processedLine }} />
                  );
                }

                i++;
              }

              return elements;
            })()}
          </div>
        </motion.div>
      </div>
    </motion.div>
  );
};

export default VoleurWalkthrough;
